import { Button, Alert } from "reactstrap";
import client from "../lib/apollo";
import Layout from "../components/Layout";
export default () => {
  console.log(client);
  return (
    <Layout>
      <div>
        <Alert color="primary">
          Hello Project is strapi-next with Bootstrap
        </Alert>
        &nbsp; <Button color="primary">Hello from nextjs</Button>
      </div>
    </Layout>
  );
};
